import React from 'react';
import './style.css';
import ClearOne from './ClearOne.js';
import { connect } from 'react-redux';
class NewMessageRow extends React.Component {
	render() {
        return (
            <tr>
                <td>afdf</td>
                <td>bfdfd</td>
                <td>A</td>
                <td>blahblahblahblahblahblahblahblah</td>
                <td>2019-05-18 17:04</td>
                <td><ClearOne/></td>
            </tr>            
        );
    }
}
const mapStateToProps = (state) => {
    return { mes: state.count };
    }

export default  connect(mapStateToProps)(NewMessageRow);
